import React from 'react';

function Footer() {
  return (
    <footer className="footer">
      <p>SafePlate &copy; 2025. All rights reserved.</p>
      <p>This is an educational tool. Always consult a healthcare provider for advice.</p>
    </footer>
  );
}

export default Footer;
